import React from 'react'
import {useFormik} from 'formik'

function AddEmployee()
{

        const employee = useFormik({
            initialValues : {
                firstname : '',
                lastname : '',
                gender : '',
                qual : ''
            },
            onSubmit : (values)=>{
                 console.log(values)
            }
        })
    return (
        <section>

             <form onSubmit={employee.handleSubmit}>
                <input type='text' {...getFieldByProps('firstname')}/> <br/>
                <input type='text' {...getFieldByProps('lastname')}/> <br/>
                <input type='radio' value= 'Male' {...getFieldByProps('gender')}/> <br/>
                <input type='radio' value= 'Female' {...getFieldByProps('gender')}/> <br/>
                <input type='text' {...getFieldByProps('qual')}/> <br/>
                
                 <button type='submit'>Submit</button>
             </form>
            

        </section>
    )
}

export default AddEmployee
